import React from 'react';

import Header from '../components/01_sections/header/HomeHeader';
import RightFixed from '../components/01_sections/rightFixed/RightFixed';
import About from '../components/01_sections/home_about/About';
import Portfolio from '../components/01_sections/home_portfolio/Portfolio';
import Experience from '../components/01_sections/home_experience/Experience';
// import Contact from '../01_sections/home_contact/Contact';
import Footer from '../components/01_sections/home_footer/Footer';

function Home() {
  return (
    <div className="App">
      <Header />
      <RightFixed />
      <About />
      <Portfolio />
      <Experience />
      {/* <Contact /> */}
      <Footer />
    </div>
  );
}

export default Home;
